def get_place():
    map_flat = []
    for l in map:
        for x in l:
            map_flat.append(x)
    if color == 2:
        for i in range(64):
            if map_flat[i] != 0:
                map_flat[i] = 3 - map_flat[i]

    ans = xiaqi(map_flat)
    for x in ans:
        row = x // 8
        col = x - row * 8
        if check(row, col, color):
            return x
    return -1

